import * as React from "react";
import Moment from 'react-moment';
import AutoScale from 'react-auto-scale';
import gql from "graphql-tag";
import { useQuery, useMutation, useLazyQuery, useApolloClient } from "@apollo/react-hooks";
// Style
import './SlideSettings.styl'; 
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { 
    faToggleOff,
    faToggleOn,
    faArrowLeft,
    faCheck,

} from '@fortawesome/free-solid-svg-icons'

// GraphQL 
const UPDATE_SLIDE_BY_ID = gql`
    mutation updateSlideById($DeckId:ID!, $SlideId:ID!, $SlideInput:SlideInput!) {
        updateSlideById(DeckId:$DeckId, SlideId:$SlideId, SlideInput:$SlideInput) 
    }
`;

// Types
type SlideProps = {
    slide:Slide
    handler:Function
}
type Slide = {
    _id:string
}

//
// Function
//

const SlideSettings: React.FunctionComponent<SlideProps> = (props:any) => {
    // Set States
    const [getSlideSettings, setSlideSettings] = React.useState(props.slide);
    const [getDelete, setDelete] = React.useState(false)
    // GraphQL - M's
    const [ callUpdateSlideById, { loading:updateSlideByIdMutationLoading, error:updateSlideByIdMutationError }] = useMutation(UPDATE_SLIDE_BY_ID);

    //
    // Use Effect
    //

    React.useEffect(() => {
        // No Functionality  
    },[]);

    //
    // Set Data
    //

    const setData = async (key, value) => {
        setSlideSettings({ ...getSlideSettings, [key]:value});
    }

    // 
    // Submit Settings
    //

    const submitSettings = async () => {
        event.preventDefault();
        try {
            const res = await callUpdateSlideById({ 
                variables: {  
                    "DeckId": "5de51149c3a3756d9d09a3d9",
                    "SlideId": "5de51419f0c3396dd58af97d",
                    "SlideInput": {
                        "size": "widescreen"
                    }
                }
            });
            if(res.data.updateSlideById) {
                props.handler('reset');
            }
        } catch(err) {
            console.log(`Login Error (`+err+`)`)
        }
    }

    //
    // Submit Delete
    //

    const submitDelete = async () => {
        event.preventDefault();
        try {
            const res = await callUpdateSlideById({ 
                variables: {  
                    "DeckId": "5de51149c3a3756d9d09a3d9",
                    "SlideId": "5de51419f0c3396dd58af97d",
                    "SlideInput": {
                        "delete": true
                    }
                }
            });
            if(res.data.updateSlideById) {
                props.handler('reset');
            }
        } catch(err) {
            console.log(`Login Error (`+err+`)`)
        }
    }

    // Return
    return (
        <>
            <form>
                <div className="form-header">
                    <div className="header-cancel-button" onClick={(event) => props.handler('reset') }>
                        <FontAwesomeIcon icon={faArrowLeft}/>
                    </div>
                    <div className="header-submit-button" onClick={(event) => submitSettings() }>
                        <FontAwesomeIcon icon={faCheck}/>
                    </div>
               </div>
                <div className="form-item">
                    <div className="item-label">Name</div>
                    <input type="text" onChange={(event) => setSlideSettings({ ...getSlideSettings, ['name']:event.target.value})} value={getSlideSettings.name} placeholder="Slide Name (Optional)"/>
                </div>
                <div className="form-item">
                    <div className="item-label">Slug</div>
                    <input type="text" onChange={(event) => setSlideSettings({ ...getSlideSettings, ['slug']:event.target.value})} value={getSlideSettings.slug} placeholder="Slide Slug (Optional)"/>
                </div>
                <div className="form-item">
                    <div className="item-label">Visibility</div>
                    <div className="item-switch" >
                        <div className="switch-text">Currently {getSlideSettings.visibility && <b>Visible</b>} {!getSlideSettings.visibility && <b>Hidden</b>}</div>
                        {!getSlideSettings.visibility && 
                            <div className="switch-icon" onClick={(event) => setData('visibility',true) }>
                                <FontAwesomeIcon icon={faToggleOff}/> 
                            </div>
                        }
                        {getSlideSettings.visibility && 
                            <div className="switch-icon" onClick={(event) => setData('visibility',false) }>
                                <FontAwesomeIcon icon={faToggleOn}/> 
                            </div>
                        }
                    </div>
                </div>
                <div className="form-item">
                    <div className="item-label">Ratio</div>
                    <div className="item-screen-ratio">
                        <div className={ getSlideSettings.ratio === 'wide' ? 'ratio-wide ratio-wide-active':'ratio-wide'} onClick={(event) => setData('ratio','wide') }>
                            <div className="wide-icon"></div>
                            <div className="wide-label">Widescreen</div>
                        </div>
                        <div className={ getSlideSettings.ratio === 'standard' ? 'ratio-normal ratio-normal-active':'ratio-normal'} onClick={(event) => setData('ratio','standard') }>
                            <div className="normal-icon"></div>
                            <div className="normal-label">Standard</div>                      
                        </div>
                    </div>
                </div>
                <div className="form-item">
                    { !getDelete && <div className="item-delete-button" onClick={(event) => setDelete(true) }>Delete Slide</div>}
                    { getDelete && <div className="item-delete-confirm-button flash" onClick={(event) => submitDelete()}>Confirm Deletion</div>}
                    { getDelete && <div className="item-delete-cancel-button" onClick={(event) => setDelete(false)}>Cancel</div>}
                </div>
            </form>
        </>
    );
};

export default SlideSettings
